import start0 from "./images/start0.png";

export default function HangmanLogic() {
  return (
    <div class="flex flex-wrap justify-center object-center">
      <div class="w-1/5 sm:w-1/6 md:w-6/12">
        <img
          src={start0}
          className="shadow rounded align-middle border-none"
          alt="hangmangame"
        />
      </div>
    </div>
  );
}
